import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const JoinSessionPage = () => {
  const [sessionId, setSessionId] = useState('');
  const history = useNavigate();

  const handleJoinSession = () => {
    // Implement logic to join an existing session
    // For now, let's assume you have an API endpoint for joining sessions
    // You may replace this with your actual API endpoint
    fetch(`/api/join-session/${sessionId}`)
      .then(response => {
        if (response.ok) {
          return response.json();
        }
        throw new Error('Failed to join session');
      })
      .then(data => {
        // Redirect to the joined session
        history.push(`/session/${data.sessionId}`);
      })
      .catch(error => {
        console.error('Error joining session:', error);
        // Handle error
      });
  };

  const handleInputChange = event => {
    setSessionId(event.target.value);
  };

  return (
    <div>
      <h2>Join an Existing Session</h2>
      <input
        type="text"
        placeholder="Enter session ID"
        value={sessionId}
        onChange={handleInputChange}
      />
      <button onClick={handleJoinSession}>Join Session</button>
    </div>
  );
};

export default JoinSessionPage;
